B.UP=new A.L(B.xO,["About","Projects","Certifications","Multi-Platform Developer","IT Support Specialist","Services","I empower seamless, cross-platform solutions and offer top-notch IT support for a connected world.","Show more","Years of Experience","Projects","Certificates","I've been deeply immersed in the world of technology as an IT Support professional. Over four years, I've meticulously managed ","IT infrastructure",", ensured software and hardware are up-to-date, and provided responsive ","helpdesk support.","Meticulous computer assembly, troubleshooting hardware and software issues, OS installation, and configuring required applications. Additionally, it includes setting up local area networks (LAN) for seamless connectivity in the company's work environment.","Teach programming fundamentals using C++ to first-grade students, introduce Java-based object-oriented programming concepts to second graders, and cover advanced Java topics with a focus on MySQL database integration for third graders.","Managed IT infrastructure maintenance, created pharmaceutical running-text advertisements with Arduino-configured LED modules, and developed pharmaceutical applications using Visual Basic .NET with features such as inventory and sales management.","Planning and executing technology infrastructure procurement, managing budgets, IT asset management, configuring secure Mikrotik-based networks, performing OS and hardware installations.","Rhealth application is designed to provide customers with easy access to their medication information by using QR codes generated by pharmacy administrators.","Rsite is a website application designed to introduce myself. With a modern user interface, you can customize the primary color, switch between light and dark modes, and change the language.","verify","Design by Me","Build with Flutter "," using Material 3 and Provider."],t.yf)
