B.UQ=new A.L(B.xO,["Tentang","Proyek","Sertifikasi","Pengembang Multi-Platform","Spesialis Dukungan TI","Layanan","Saya memberdayakan solusi lintas platform yang mulus dan menawarkan dukungan TI terbaik untuk dunia yang terhubung.","Tampilkan lebih banyak","Tahun Pengalaman","Proyek","Sertifikat","Saya telah tenggelam dalam dunia teknologi sebagai profesional Dukungan TI. Selama empat tahun, saya dengan teliti mengelola ","infrastruktur TI",", memastikan perangkat lunak dan perangkat keras tetap terkini, dan memberikan ","dukungan helpdesk yang responsif.","Perakitan komputer yang teliti, pemecahan masalah perangkat keras dan perangkat lunak, instalasi sistem operasi, dan konfigurasi aplikasi yang diperlukan. Selain itu, termasuk pengaturan jaringan area lokal (LAN) untuk konektivitas yang mulus di lingkungan kerja perusahaan.","Mengajar dasar-dasar pemrograman menggunakan C++ kepada siswa kelas satu, memperkenalkan konsep pemrograman berbasis objek Java kepada siswa kelas dua, dan membahas topik Java yang lebih lanjut dengan fokus pada integrasi basis data MySQL untuk siswa kelas tiga.","Mengelola pemeliharaan infrastruktur TI, membuat iklan tekstual berjalan farmasi dengan modul LED yang dikonfigurasi Arduino, dan mengembangkan aplikasi farmasi menggunakan Visual Basic .NET dengan fitur seperti manajemen inventaris dan penjualan.","Perencanaan dan pelaksanaan pengadaan infrastruktur teknologi, pengelolaan anggaran, manajemen aset TI, konfigurasi jaringan berbasis Mikrotik yang aman, melakukan instalasi sistem operasi dan perangkat keras.","Aplikasi Rhealth dirancang untuk memberikan akses mudah bagi pelanggan ke informasi obat mereka dengan menggunakan kode QR yang dihasilkan oleh administrator farmasi.","Rsite adalah aplikasi situs web yang dirancang untuk memperkenalkan diri saya. Dengan antarmuka pengguna modern, Anda dapat menyesuaikan warna utama, beralih antara mode terang dan gelap, dan mengubah bahasa.","verifikasi","Desain oleh Saya Sendiri","Dibangun dengan Flutter "," menggunakan Material 3 dan Provider."],t.yf)
